Tarumae.Axis3DCursor = function(renderer) {
  this.renderer = renderer;

  this.position = new vec3(0, 0, 0);
  this.screenPosition = new vec2(0, 0);
  this.enabled = false;

  this.arrows = {
    x: {
      dir: new vec3(1, 0, 0), color: "#00ff00",
      enabled: true, screenPosition: new vec2(0, 0),
      planeVertices: TarumaeEditor.AxisPlaneVertices.x,
    },
    y: {
      dir: new vec3(0, 1, 0), color: "#ff0000",
      enabled: true, screenPosition: new vec2(0, 0),
      planeVertices: TarumaeEditor.AxisPlaneVertices.y,
    },
    z: {
      dir: new vec3(0, 0, 1), color: "#0000ff",
      enabled: true, screenPosition: new vec2(0, 0),
      planeVertices: TarumaeEditor.AxisPlaneVertices.z,
    },
  };

  this.selectedArrow = null;
  this.lastMousePosition = null;
};

new Tarumae.EventDispatcher(Tarumae.Axis3DCursor).registerEvents(
  "axisXMove", "axisYMove", "axisZMove"
);

Tarumae.Axis3DCursor.Length = 0.8;

Object.assign(Tarumae.Axis3DCursor.prototype, {
  init: function(){
  },

  show: function() {
    this.enabled = true;
  },

  hide: function() {
    this.enabled = false;
  },

  draw: function() {
    if (this.enabled) {
      var renderer = this.renderer;
 
      this.screenPosition = renderer.transformPoint(this.position);
 
      this.drawArrow(this.arrows.x);
      this.drawArrow(this.arrows.y);
      this.drawArrow(this.arrows.z);
    }
  },

  drawArrow: function(arrow) {
    var renderer = this.renderer;
    var viewer = renderer.viewer;

    var to = arrow.dir.mul(Tarumae.Axis3DCursor.Length).mul(viewer.scale.z);
  
    to = this.position.add(to);

    arrow.screenPosition = renderer.transformPoint(to, null);
  
    renderer.drawArrow2D(this.screenPosition, arrow.screenPosition, 2, arrow.color);
  },

  onmousedown: function() {
    if (!this.enabled) return false;

    var scene = this.renderer.currentScene;
    var viewer = this.renderer.viewer;
    
    if (!scene || !viewer) return;
  
    var p = viewer.mouse.position;

    this.selectedArrow = null;
    
    var hitAxis;

    if (this.checkArrowHittedByPosition(this.arrows.x, p)) {
      hitAxis = this.arrows.x;
    }

    if (this.checkArrowHittedByPosition(this.arrows.y, p)) {
      hitAxis = this.arrows.y;
    }

    if (this.checkArrowHittedByPosition(this.arrows.z, p)) {
      hitAxis = this.arrows.z;
    }

    if (hitAxis) {
      var out = scene.renderer.viewRayHitTestPlaneInWorldSpace(
        this.renderer.viewer.mouse.position, this.getAxisPlaneVertices(hitAxis));
    
      if (out) {
        this.selectedArrow = hitAxis;
        this.lastMousePosition = out.hit;
        return true;
      }
    }

    return false;
  },

  ondrag: function() {
    if (!this.enabled) return false;

    var scene = this.renderer.currentScene;

    if (this.selectedArrow && scene) {

      var out = scene.renderer.viewRayHitTestPlaneInWorldSpace(this.renderer.viewer.mouse.position,
        this.getAxisPlaneVertices(this.selectedArrow));

      if (out) {
        var off;

        switch (this.selectedArrow) {
          case this.arrows.x:
            off = out.hit.x - this.lastMousePosition.x;
            this.onaxisXMove(off);
            this.position.x += off;
            break;

          case this.arrows.y:
            off = out.hit.y - this.lastMousePosition.y;
            this.onaxisYMove(off);
            this.position.y += off;
            break;

          case this.arrows.z:
            off = out.hit.z - this.lastMousePosition.z;
            this.onaxisZMove(off);
            this.position.z += off;
            break;
        }

        this.lastMousePosition = out.hit;
      }
    }
  },

  getAxisPlaneVertices: function(axis) {
    return {
      v1: vec3.add(this.position, axis.planeVertices.v1),
      v2: vec3.add(this.position, axis.planeVertices.v2),
      v3: vec3.add(this.position, axis.planeVertices.v3),
    };
  },

  checkArrowHittedByPosition: function(arrow, p) {
    var bounds = Rect.createFromPoints(this.screenPosition, arrow.screenPosition);
  
    if (bounds.width < 8) {
      bounds.x -= 4;
      bounds.width = 8;
    }

    if (bounds.height < 8) {
      bounds.y -= 4;
      bounds.height = 8;
    }

    return arrow.enabled
      && bounds.contains(p)
      && (Tarumae.MathFunctions.distancePointToLine(this.screenPosition, arrow.screenPosition, p) < 6);
  },

});

///////////////// Tarumae.Multi3DCursor /////////////////

Tarumae.Multi3DCursor = function(renderer) {
  this.renderer = renderer;

  this.position = new vec3(0, 0, 0);
  this.screenPosition = new vec2(0, 0);
  this.enabled = false;

  this.arrows = this.getArrows();

  this.selectedArrow = null;
  this.MouseDownPosition = null;
  this.lastMousePosition = null;//point while dragging

}

new Tarumae.EventDispatcher(Tarumae.Multi3DCursor).registerEvents(
  "axisXMove", "axisYMove", "axisZMove",
  "axisXRotate", "axisYRotate", "axisZRotate",
  "axisXScale", "axisYScale", "axisZScale",
);

// Tarumae.Multi3DCursor.Length = 0.8;

Object.assign(Tarumae.Multi3DCursor.prototype, {
  init: function(scene){
    this.arrows.visible = false;
    this.renderer.currentScene.add(this.arrows);
  },

  show: function() {
    this.enabled = true;
    this.arrows.location = this.position;
    this.arrows.visible = true;
    this.changeMode('translation');
  },

  hide: function() {
    this.enabled = false;
    this.arrows.visible = false;
  },

  getSceneObjects: function(){
    return this.arrows;
  },

  draw: function() {
    //Nothing to do on every frame
  },

  // drawArrow: function(arrow) {
  // },

  /**
   * @todo
   */
  toggleScale: function(sw){
    if ( sw ){
      this.arrows.scale.set(10,10,10);
    } else {
      this.arrows.scale.set(1,1,1);
    }
  },

  onkeydown: function(key,withShift){
    var scene = this.renderer.currentScene;
    var viewer = this.renderer.viewer;
    this.toggleScale(withShift);

    switch (key) {
      case Tarumae.Viewer.Keys.Q:
        this.changeMode('translation');
        break;
      case Tarumae.Viewer.Keys.E:
        this.changeMode('rotation');
        break;
      case Tarumae.Viewer.Keys.R:
        this.changeMode('scaling');
        break;
    }
  },

  onmousedown: function() {
    if (!this.enabled) return false;

    var _this = this;
    var scene = this.renderer.currentScene;
    var viewer = this.renderer.viewer;
    
    if (!scene || !viewer) return false;

    this.selectedArrow = null;

    var out = scene.findObjectsByCurrentMousePosition({
      filter: function(obj) {
        // return obj.type == Tarumae.ObjectTypes.Cursor;
        return obj.type == Tarumae.ObjectTypes.Cursor || obj.childOf(_this.arrows);
      },
      cullingSurfaceBack: true,
    });

    if (out && out.object) {
      var obj = this.findParentObjectByType(out.object, Tarumae.ObjectTypes.Cursor);
      if ( obj.enabled ){
        this.selectedArrow = obj;
        this.MouseDownPosition = out.worldPosition;
        this.lastMousePosition = out.worldPosition;
        return true;
      }
    }

    this.selectedArrow = null;
    this.MouseDownPosition = null;
    this.lastMousePosition = null;

  },

  ondrag: function() {
    if (!this.enabled) return false;

    var scene = this.renderer.currentScene;
    var viewer = this.renderer.viewer;

    if (this.selectedArrow && scene) {
      var out = this.renderer.viewRayHitTestPlaneInWorldSpace(
                  viewer.mouse.position, 
                  this.getAxisPlaneVertices(this.selectedArrow)
      );
      if (out && out['hit']) {
        var origin = out.hit.clone().sub( this.MouseDownPosition );
        var offset = out.hit.clone().sub( this.lastMousePosition );

        if (this.selectedArrow['onmove'] && typeof this.selectedArrow['onmove'] === "function") {
          this.selectedArrow.onmove.call(this,offset,origin);
        }

        this.lastMousePosition = out.hit;
      }
    }
  },

  getAxisPlaneVertices: function(axis) {
    var vertices = ( 
        axis.planeAxis in TarumaeEditor.AxisPlaneVertices
    )? TarumaeEditor.AxisPlaneVertices[axis.planeAxis] : axis.planeVertices;

    return {
      v1: vec3.add(this.position, vertices.v1),
      v2: vec3.add(this.position, vertices.v2),
      v3: vec3.add(this.position, vertices.v3),
    };
  },


  /**
  * @see: object.js
  * @todo: move to engine
  */
  findParentObjectByType: function(obj,type) {
    if (obj.type == type) { return obj; }
      while (obj.parent) {
        if (obj.parent.type == type) {
          return obj.parent;
        }
        obj = obj.parent;
      }
    return false;
  },

  // checkArrowHittedByPosition: function(arrow, p) {
  // },

  initEnabled: function(){
    var objs = this.arrows.findObjectsByType(Tarumae.ObjectTypes.Cursor);
    for ( var i = 0; i<objs.length; i++){
      objs[i].visible = objs[i].enabled;
    }
  },

  changeMode: function(mode){
    var scene = this.renderer.currentScene;
    var viewer = this.renderer.viewer;

    if (!scene) { return; }

    if ( mode in this.arrows ){
      var objs = this.arrows.objects;
      for ( var i = 0; i<objs.length; i++){
        objs[i].visible = false;
      }
      this.arrows[mode].visible = true;

      this.initEnabled();
      this.arrows.angle = new vec3(0,0,0);
      scene.requireUpdateFrame();
    }
  },

  getArrows: function() {
    // there will be common API that creates mesh from js easier in future version
    var getCursorAxisMeshInstance = function(cursorMeshDataDefine) {
      // only create mesh instance at first time
      if (cursorMeshDataDefine.mesh === undefined) {
        var arr = cursorMeshDataDefine.vertices;
        var mesh = new Tarumae.Mesh();
        mesh.vertexBuffer = new Float32Array(arr);
        mesh.meta = {
          vertexCount: arr.length / 3,
          hasNormal: false,
          hasTexcoord: false
        };
        // keep a mesh instance cache
        cursorMeshDataDefine.mesh = mesh;
      }

      return cursorMeshDataDefine.mesh;
    };

    return {
      _models: {
        "editor/translation_1axis": {
          type: Tarumae.ObjectTypes.Cursor,
          mesh: new Tarumae.CubeMesh(),
          scale: [1,0.05,0.05],
          shader: { name: "solidcolor", color: new color4(0,1,0,1) },

          enabled: true,
        },
        "editor/translation_2axis": {
          type: Tarumae.ObjectTypes.Cursor,
          mesh: new Tarumae.CubeMesh(),
          scale: [0.2,0.01,0.2],//X-Y plane
          shader: { name: "solidcolor", color: new color4(0,1,0,1) },

          enabled: true,
        },
        "editor/rotation_1axis": {
          type: Tarumae.ObjectTypes.Cursor,
          // sphere: new Tarumae.Shapes.Sphere(),
          // guid: { mesh: new Tarumae.CubeMesh(), location: [0,0,0], scale: [2,0.1,2.1] },
          // location: [0,0,0], scale: [0.1,1,1],
          // mesh: "models/editor/rotation_x.mesh",//X-axis
          mesh: getCursorAxisMeshInstance(Tarumae.Multi3DCursor.CursorMesh.RotationX),
          scale: [2,2,5],
          shader: { name: "solidcolor", color: new color4(0,1,0, 1) },

          enabled: true,
        },
        // "editor/scaling_1axis": {//TODO
        //   type: Tarumae.ObjectTypes.Cursor,
        //   cube: { mesh: new Tarumae.CubeMesh(), location: [1,0,0]  , scale: [0.1,0.1,0.1] },
        //   guid: { mesh: new Tarumae.CubeMesh(), location: [0.5,0,0], scale: [1,0.01,0.01] },
        //   shader: { name: "solidcolor", color: new color4(0,1,0, 1) },

        //   enabled: true,
        // }
      },
      translation: {
        visible: false,
        x: {
          model: "editor/translation_1axis",
          location: [0.5,0,0], planeAxis: "xy",

          onmove: function (off){
            this.onaxisXMove(off.x);
            this.position.x += off.x;
            this.arrows.location.x += off.x;
          }
        },
        y: {
          model: "editor/translation_1axis",
          location: [0,0.5,0], angle: [0,0,90], planeAxis: "yz",
          shader: { name: "solidcolor", color: new color4(1,0,0,1) },

          onmove: function (off){
            this.onaxisYMove(off.y);
            this.position.y += off.y;
            this.arrows.location.y += off.y;
          },
        },
        z: {
          model: "editor/translation_1axis",
          location: [0,0,0.5], angle: [0,90,0], planeAxis: "xz",
          shader: { name: "solidcolor", color: new color4(0,0,1,1) },

          onmove: function (off){
            this.onaxisZMove(off.z);
            this.position.z += off.z;
            this.arrows.location.z += off.z;
          },
        },

        xy: {
          model: "editor/translation_2axis",
          location: [0.1,0.1,0],  angle: [90,0,0], planeAxis: "xy",

          onmove: function (off){
            this.onaxisXMove(off.x);
            this.onaxisYMove(off.y);
            this.position.x += off.x;
            this.position.y += off.y;
            this.arrows.location.x += off.x;
            this.arrows.location.y += off.y;
          }
        },
        yz: {
          model: "editor/translation_2axis",
          location: [0,0.1,0.1],  angle: [0,0,90], planeAxis: "yz",
          shader: { name: "solidcolor", color: new color4(1,0,0,1) },

          onmove: function (off){
            this.onaxisYMove(off.y);
            this.onaxisZMove(off.z);
            this.position.y += off.y;
            this.position.z += off.z;
            this.arrows.location.y += off.y;
            this.arrows.location.z += off.z;
          },
        },
        xz: {
          model: "editor/translation_2axis",
          location: [0.1,0,0.1], planeAxis: "xz",
          shader: { name: "solidcolor", color: new color4(0,0,1,1) },

          onmove: function (off){
            this.onaxisXMove(off.x);
            this.onaxisZMove(off.z);
            this.position.x += off.x;
            this.position.z += off.z;
            this.arrows.location.x += off.x;
            this.arrows.location.z += off.z;
          },
        },
      },

      rotation: {
        visible: false,
        x: {
          model: "editor/rotation_1axis",
          angle: [0,90,0], planeAxis: "xy",

          onmove: function (off){
            this.onaxisXRotate(off.x*10);
            this.arrows.angle.x += off.x*10;
          }
        },
        y: {
          model: "editor/rotation_1axis",
          angle: [90,0,0], planeAxis: "yz",
          shader: { name: "solidcolor", color: new color4(1,0,0, 1) },

          onmove: function (off){
            this.onaxisYRotate(off.y*10);
            this.arrows.angle.y += off.y*10;
          }
        },
        z: {
          model: "editor/rotation_1axis",
          planeAxis: "xz",
          shader: { name: "solidcolor", color: new color4(0,0,1, 1) },

          onmove: function (off){
            this.onaxisZRotate(off.z*10);
            this.arrows.angle.z += off.z*10;
          }
        },
      },

      scaling: {
        visible: false,
        x: {
          // model: "editor/scaling_1axis",//TODO
          type: Tarumae.ObjectTypes.Cursor,
          cube: { mesh: new Tarumae.CubeMesh(), location: [1,0,0]  , scale: [0.1,0.1,0.1] },
          guid: { mesh: new Tarumae.CubeMesh(), location: [0.5,0,0], scale: [1,0.01,0.01] },
          planeAxis: "xy",
          shader: { name: "solidcolor", color: new color4(0,1,0, 1) },

          enabled: true,
          onmove: function (offset){
            this.onaxisXScale( offset.x + 1 || 1);
          }
        },
        y: {
          // model: "editor/scaling_1axis",//TODO
          type: Tarumae.ObjectTypes.Cursor,
          cube: { mesh: new Tarumae.CubeMesh(), location: [1,0,0]  , scale: [0.1,0.1,0.1] },
          guid: { mesh: new Tarumae.CubeMesh(), location: [0.5,0,0], scale: [1,0.01,0.01] },
          angle: [0,0,90], planeAxis: "yz",
          shader: { name: "solidcolor", color: new color4(1,0,0, 1) },

          enabled: true,
          onmove: function (offset){
            this.onaxisYScale( offset.y + 1 || 1);
          }
        },
        z: {
          // model: "editor/scaling_1axis",//TODO
          type: Tarumae.ObjectTypes.Cursor,
          cube: { mesh: new Tarumae.CubeMesh(), location: [1,0,0]  , scale: [0.1,0.1,0.1] },
          guid: { mesh: new Tarumae.CubeMesh(), location: [0.5,0,0], scale: [1,0.01,0.01] },
          angle: [0,-90,0], planeAxis: "xz",
          shader: { name: "solidcolor", color: new color4(0,0,1, 1) },

          enabled: true,
          onmove: function (offset){
            this.onaxisZScale( offset.z + 1 || 1);
          }
        },
        xyz: {
          // model: "editor/scaling_1axis",//TODO
          type: Tarumae.ObjectTypes.Cursor,
          cube: { mesh: new Tarumae.CubeMesh(), location: [1,0,0]  , scale: [0.1,0.1,0.1] },
          guid: { mesh: new Tarumae.CubeMesh(), location: [0.5,0,0], scale: [1,0.01,0.01] },
          angle: [45,0,45], planeAxis: "xz",
          shader: { name: "solidcolor", color: new color4(1,0,1, 1) },

          enabled: true,
          onmove: function (offset){
            this.onaxisXScale( offset.x + 1 || 1);
            this.onaxisYScale( offset.x + 1 || 1);
            this.onaxisZScale( offset.x + 1 || 1);
          }
        },
      }
    }
  },

});

